import React from "react";

export default function BackPreview() {
	return (
		<>
			<div className="back-preview">
				<div className="back-ele">Customer Care Contact</div>
				<div className="back-ele">Black tape</div>
				<div className="back-ele cvv-div">
					<div className="back-ele-seal">Seal</div>
					<div className="back-ele-cvv">CVV</div>
				</div>
			</div>
		</>
	);
}
